import React, { Component } from 'react';
import styled from 'styled-components'
import { connect } from 'react-redux';

const GetStartedDiv = styled.div`
    color: white;
    width: 100%;   
    text-align: right;
    margin-top: 115px;
    padding: 16px;
    background-color: rgba(20, 18, 24, 0.75);
    font-size: 24px;
    box-sizing: border-box;	
`;

const FlexChild = styled.div`
    position: relative;
    width: 49%;
	width: ${props => props.width || ''};  
    box-sizing: border-box; 
    
	@media screen and (max-width: 1190px) {
		margin: 20px 5px;
		min-width: 98%;
	}
`;

const Block = styled.div`
    position: absolute;
    margin: auto;
    z-index: 9999;
    max-width: 600px;
    border-radius: 4px;
    background-color: white;
   
`;

const Error = styled.div`
    width: 64px;
    height: 64px;
    border-radius: 50%;
    border: 1px solid #E62416;
    text-align: center;
    line-height: 64px;
    color: #E62416;
`;

class PopUpDelete extends Component {
	constructor(props) {
		super(props);
		this.state ={};
	}

    render() {
		return (
            <Block>
                <Error>!</Error>
            </Block>
        );
	}
}

function mapStateToProps(state) {
	return {
	
	}
}

export default connect(mapStateToProps, null)(PopUpDelete)
